import{_ as e}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as a,c as o,e as r}from"./app.71c832ff.js";const d={},h=r('<h1 id="\u524D\u8A00" tabindex="-1"><a class="header-anchor" href="#\u524D\u8A00" aria-hidden="true">#</a> \u524D\u8A00</h1><h2 id="\u4EC0\u4E48\u662F\u5206\u5E03\u5F0F\u6846\u67B6" tabindex="-1"><a class="header-anchor" href="#\u4EC0\u4E48\u662F\u5206\u5E03\u5F0F\u6846\u67B6" aria-hidden="true">#</a> \u4EC0\u4E48\u662F\u5206\u5E03\u5F0F\u6846\u67B6</h2><p>\u5206\u5E03\u5F0F\u7CFB\u7EDF\u662F\u82E5\u5E72\u72EC\u7ACB\u7CFB\u7EDF\u7684\u96C6\u5408, \u4F46\u662F\u7528\u6237\u4F7F\u7528\u8D77\u6765\u50CF\u662F\u5728\u4F7F\u7528\u4E00\u5957\u7CFB\u7EDF.</p><h2 id="\u4E3A\u4EC0\u4E48\u9700\u8981\u5206\u5E03\u5F0F\u7CFB\u7EDF" tabindex="-1"><a class="header-anchor" href="#\u4E3A\u4EC0\u4E48\u9700\u8981\u5206\u5E03\u5F0F\u7CFB\u7EDF" aria-hidden="true">#</a> \u4E3A\u4EC0\u4E48\u9700\u8981\u5206\u5E03\u5F0F\u7CFB\u7EDF</h2><p>\u89C4\u6A21\u7684\u9010\u6B65\u6269\u5927\u548C\u4E1A\u52A1\u7684\u590D\u6742\uFF0C\u5355\u53F0\u8BA1\u7B97\u673A\u625B\u4E0D\u4F4F\u53CC\u5341\u4E00\u90A3\u6837\u7684\u6D41\u91CF\uFF0C\u4FD7\u8BDD\u8BF4\uFF1A\u4E09\u4E2A\u81ED\u76AE\u5320\u62B5\u4E00\u4E2A\u8BF8\u845B\u4EAE\u3002</p><h2 id="\u5E94\u7528\u67B6\u6784\u7684\u53D1\u5C55\u6F14\u53D8" tabindex="-1"><a class="header-anchor" href="#\u5E94\u7528\u67B6\u6784\u7684\u53D1\u5C55\u6F14\u53D8" aria-hidden="true">#</a> \u5E94\u7528\u67B6\u6784\u7684\u53D1\u5C55\u6F14\u53D8</h2><h3 id="\u5355\u4E00\u67B6\u6784" tabindex="-1"><a class="header-anchor" href="#\u5355\u4E00\u67B6\u6784" aria-hidden="true">#</a> \u5355\u4E00\u67B6\u6784</h3><p>\u5F53\u7F51\u7AD9\u6D41\u91CF\u5F88\u5C0F\u7684\u65F6\u5019,\u6211\u4EEC\u5C06\u6240\u6709\u7684\u5E94\u7528(\u4E1A\u52A1)\u653E\u5230\u4E00\u53F0\u670D\u52A1\u5668\u4E0A, \u6253\u5305\u8FD0\u884C\u516C\u53F8\u7BA1\u7406\u7CFB\u7EDF/\u8D85\u5E02\u6536\u94F6\u7CFB\u7EDF.</p><blockquote><p>\u4F18\u70B9: \u5F00\u53D1\u7B80\u5355,\u90E8\u7F72\u7B80\u5355 \u7F3A\u70B9: \u6269\u5C55\u4E0D\u5BB9\u6613(\u600E\u4E48\u5904\u7406\u65E5\u76CA\u589E\u957F\u7684\u6D41\u91CF),\u8C01\u90FD\u6539\u4E00\u4E2A,\u7EF4\u62A4\u4E0D\u5BB9\u6613,\u6027\u80FD\u63D0\u5347\u96BE</p></blockquote><h3 id="\u5782\u76F4\u5E94\u7528\u67B6\u6784" tabindex="-1"><a class="header-anchor" href="#\u5782\u76F4\u5E94\u7528\u67B6\u6784" aria-hidden="true">#</a> \u5782\u76F4\u5E94\u7528\u67B6\u6784</h3><p>\u5C06\u5927\u5E94\u7528\u62C6\u5206\u6210\u4E3A\u5C0F\u5E94\u7528(\u4E00\u822C\u6309\u7167\u4E1A\u52A1\u62C6\u5206),\u6839\u636E\u4E0D\u540C\u7684\u8BBF\u95EE\u9891\u7387\u51B3\u5B9A\u5404\u81EA\u4E1A\u52A1\u90E8\u7F72\u7684\u670D\u52A1\u5668\u6570\u91CF</p><blockquote><p>\u4F18\u70B9: \u6269\u5C55\u5BB9\u6613 \u7F3A\u70B9: \u9875\u9762\u4E00\u6539, \u53EF\u80FD\u9020\u6210\u6574\u4E2A\u9879\u76EE\u91CD\u65B0\u90E8\u7F72, \u4E1A\u52A1\u548C\u754C\u9762\u6CA1\u6709\u5206\u79BB\u5F00, \u968F\u7740\u4E1A\u52A1\u79CD\u7C7B\u589E\u52A0, \u600E\u4E48\u89E3\u51B3\u4E1A\u52A1\u4E4B\u95F4\u7684\u4E92\u76F8\u8C03\u7528\u95EE\u9898, \u8BA2\u5355\u670D\u52A1\u5668\u548C\u7528\u6237\u670D\u52A1\u5668\u4EA4\u4E92\u6548\u7387\u7684\u95EE\u9898</p></blockquote><h3 id="\u5206\u5E03\u5F0F\u67B6\u6784" tabindex="-1"><a class="header-anchor" href="#\u5206\u5E03\u5F0F\u67B6\u6784" aria-hidden="true">#</a> \u5206\u5E03\u5F0F\u67B6\u6784</h3><p>\u57FA\u4E8E RPC: \u8FDC\u7A0B\u8FC7\u7A0B\u8C03\u7528</p><p>\u5C06\u4E1A\u52A1\u62C6\u5206\u540E, \u7528\u67D0\u79CD\u65B9\u5F0F\u5B9E\u73B0\u5404\u4E2A\u4E1A\u52A1\u6A21\u5757\u7684\u8FDC\u7A0B\u8C03\u7528\u548C\u590D\u7528, \u8FD9\u65F6\u4E00\u4E2A\u597D\u7684 RPC \u6846\u67B6\u5C31\u51B3\u5B9A\u4E86\u4F60\u7684\u5206\u5E03\u5F0F\u67B6\u6784\u7684\u6027\u80FD, \u600E\u4E48\u8C03\u7528, \u4F55\u65F6\u8C03\u7528, \u670D\u52A1\u5668\u6302\u4E86\u600E\u4E48\u529E......\u6211\u4EEC\u9700\u8981\u4E00\u4E2A\u6846\u67B6\u6765\u5E2E\u6211\u4EEC\u89E3\u51B3\u8FD9\u4E2A\u95EE\u9898(\u5F53\u7136\u5927\u5927\u795E\u53EF\u4EE5\u81EA\u5DF1\u5199\u4E00\u4E2A, \u4F46\u662F\u5E94\u5BF9\u5927\u6D41\u91CF\u7684\u6210\u529F\u8005\u83AB\u8FC7\u4E8E\u4E2D\u56FD\u7684\u963F\u91CC\u5DF4\u5DF4\u516C\u53F8, \u9876\u4F4F\u4E86\u6DD8\u5B9D\u53CC\u5341\u4E00\u7684\u6D41\u91CF, \u53CD\u89C2\u4E00\u4E9B\u5B66\u6821\u5185\u90E8\u7684\u9009\u8BFE\u7CFB\u7EDF, \u5BF9\u4E8E\u5927\u6D41\u91CF\u65F6\u53EA\u6709\u4E24\u4E2A\u5B57--\u5B95\u673A).</p><p>\u8FD9\u65F6, \u6211\u4EEC\u672C\u5957\u8BFE\u7A0B\u7684\u4E3B\u4EBA\u516C\u5C31\u51FA\u73B0\u4E86: Dubbo, Dubbo \u662F\u4E00\u4E2A\u9AD8\u6027\u80FD\u7684 RPC \u6846\u67B6, \u89E3\u51B3\u4E86\u5206\u5E03\u5F0F\u4E2D\u7684\u8C03\u7528\u95EE\u9898.</p><blockquote><p>\u4F18\u70B9: \u89E3\u51B3\u4E86\u5206\u5E03\u5F0F\u7CFB\u7EDF\u4E2D\u4E92\u76F8\u8C03\u7528\u7684\u95EE\u9898 \u7F3A\u70B9: \u5047\u8BBE\u6709 100 \u53F0\u670D\u52A1\u5668, 50 \u53F0\u7528\u6237\u4E1A\u52A1\u670D\u52A1\u5668, 50 \u53F0\u8BA2\u5355\u4E1A\u52A1\u670D\u52A1\u5668,\u4F46\u662F\u5728\u4E0A\u7EBF\u540E\u53D1\u73B0, \u7528\u6237\u670D\u52A1\u5668\u4F7F\u7528\u7387\u5F88\u5C0F, \u4F46\u662F\u8BA2\u5355\u670D\u52A1\u5668\u538B\u529B\u5F88\u5927, \u6700\u4F73\u914D\u6BD4\u5E94\u8BE5\u662F 1:4, \u8FD9\u65F6\u5019\u5C31\u8981\u6C42\u6211\u4EEC\u8FD8\u6709\u4E00\u4E2A\u7EDF\u4E00\u7BA1\u7406\u7684\u8C03\u5EA6\u4E2D\u5FC3</p></blockquote><h2 id="\u4E3A\u4EC0\u4E48-dubbo-\u8BF4\u81EA\u5DF1\u6027\u80FD\u9AD8" tabindex="-1"><a class="header-anchor" href="#\u4E3A\u4EC0\u4E48-dubbo-\u8BF4\u81EA\u5DF1\u6027\u80FD\u9AD8" aria-hidden="true">#</a> <strong>\u4E3A\u4EC0\u4E48</strong> <strong>Dubbo</strong> \u8BF4\u81EA\u5DF1\u6027\u80FD\u9AD8</h2><p>\u9AD8\u6027\u80FD\u8981\u4ECE\u5E95\u5C42\u7684\u539F\u7406\u8BF4\u8D77\uFF0C\u65E2\u7136\u662F\u4E00\u4E2A RPC \u6846\u67B6, \u4E3B\u8981\u5E72\u7684\u5C31\u662F\u8FDC\u7A0B\u8FC7\u7A0B(\u65B9\u6CD5)\u8C03\u7528, \u90A3\u4E48\u63D0\u5347\u6027\u80FD\u5C31\u8981\u4ECE\u6700\u5173\u952E, \u6700\u8017\u65F6\u7684\u4E24\u4E2A\u65B9\u9762\u5165\u624B: \u5E8F\u5217\u5316\u548C\u7F51\u7EDC\u901A\u4FE1.</p><blockquote><p>\u5E8F\u5217\u5316: \u6211\u4EEC\u5B66\u4E60 Java \u7F51\u7EDC\u5F00\u53D1\u7684\u65F6\u5019\u77E5\u9053, \u672C\u5730\u7684\u5BF9\u8C61\u8981\u5728\u7F51\u7EDC\u4E0A\u4F20\u8F93, \u5FC5\u987B\u8981\u5B9E\u73B0 Serializable \u63A5\u53E3, \u4E5F\u5C31\u662F\u5FC5\u987B\u5E8F\u5217\u5316.</p></blockquote><p>\u6211\u4EEC\u5E8F\u5217\u5316\u7684\u65B9\u6848\u5F88\u591A: <code>xml</code>, <code>json</code>, \u4E8C\u8FDB\u5236\u6D41\u2026\u5176\u4E2D\u6548\u7387\u6700\u9AD8\u7684\u5C31\u662F\u4E8C\u8FDB\u5236\u6D41(\u56E0\u4E3A\u8BA1\u7B97\u673A\u5C31\u662F\u4E8C\u8FDB\u5236\u7684). \u7136\u800C Dubbo \u91C7\u7528\u7684\u5C31\u662F\u6548\u7387\u6700\u9AD8\u7684\u4E8C\u8FDB\u5236.</p><blockquote><p>\u7F51\u7EDC\u901A\u4FE1: \u4E0D\u540C\u4E8E HTTP \u9700\u8981\u8FDB\u884C 7 \u6B65\u8D70(\u4E09\u6B21\u63E1\u624B\u548C\u56DB\u6B21\u6325\u624B), Dubbo \u91C7\u7528 Socket \u901A\u4FE1\u673A\u5236, \u4E00\u6B65\u5230\u4F4D, \u63D0\u5347\u4E86\u901A\u4FE1\u6548\u7387, \u5E76\u4E14\u53EF\u4EE5\u5EFA\u7ACB\u957F\u8FDE\u63A5, \u4E0D\u7528\u53CD\u590D\u8FDE\u63A5, \u76F4\u63A5\u4F20\u8F93\u6570\u636E.</p></blockquote><h2 id="\u522B\u7684-rpc-\u6846\u67B6" tabindex="-1"><a class="header-anchor" href="#\u522B\u7684-rpc-\u6846\u67B6" aria-hidden="true">#</a> <strong>\u522B\u7684</strong> <strong>RPC</strong> \u6846\u67B6</h2><p>gRPC, Thrift, HSF ...</p><h2 id="dubbo-\u7684\u524D\u4E16\u4ECA\u751F" tabindex="-1"><a class="header-anchor" href="#dubbo-\u7684\u524D\u4E16\u4ECA\u751F" aria-hidden="true">#</a> Dubbo \u7684\u524D\u4E16\u4ECA\u751F</h2><p>dubbo \u4E4B\u524D\u4E00\u76F4\u90FD\u4F5C\u4E3A Alibaba \u516C\u53F8\u5185\u90E8\u4F7F\u7528\u7684\u6846\u67B6.</p><p>2011 \u5E74,dubbo \u88AB\u6258\u7BA1\u5230\u4E86 GitHub \u4E0A(\u5F00\u6E90)</p><p>2014 \u5E74 11 \u6708\u53D1\u5E03 2.4.11 \u7248\u672C\u540E\u5BA3\u5E03\u505C\u6B62\u66F4\u65B0; \u6B64\u540E\u4E00\u6BB5\u65F6\u95F4\u5F88\u591A\u516C\u53F8\u5F00\u6E90\u4E86\u81EA\u5DF1\u57FA\u4E8E Dubbo \u7684\u53D8\u79CD\u7248\u672C(\u4F8B\u5982\u5F53\u5F53\u7F51\u7684 Dubbo X,\u7F51\u6613\u8003\u62C9\u7684 Dubbo K)</p><p>2017 \u5E74 SpringCloud \u6A2A\u7A7A\u51FA\u4E16, Dubbo \u611F\u89C9\u5230\u538B\u529B\u540E\u8FDE\u7EED\u66F4\u65B0\u4E86\u51E0\u4E2A\u7248\u672C</p><p>2018 \u5E74 1 \u6708,\u963F\u91CC\u516C\u53F8\u8054\u5408\u5F53\u5F53\u7F51\u5C06 Dubbo \u548C Dubbo X \u5408\u5E76,\u53D1\u5E03\u4E86 2.6 \u7248\u672C</p><p>2018 \u5E74\u9664\u5915\u591C\u963F\u91CC\u5C06 Dubbo \u8D21\u732E\u7ED9\u4E86 Apache \u57FA\u91D1\u4F1A</p><p>2018 \u9664\u5915\u591C\u81F3\u4ECA,Apache \u7EF4\u62A4\u548C\u66F4\u65B0 Dubbo</p>',32),b=[h];function t(i,c){return a(),o("div",null,b)}const u=e(d,[["render",t],["__file","index.html.vue"]]);export{u as default};
